import React, { Component } from "react";
import { getActors } from "../../src/actions";
import { connect } from "react-redux";
class Actors extends Component {

  componentDidMount() {
    this.props.getActors("");
  }

  render() {
    return (
      <div className="search_component">

        <div className="movie_card_wrapper">
            console.log()
          {/* {this.props.movies.map(({ id, ...otherprops }) => (
            <SingleMovie key={id} id={id} {...otherprops} />
          ))} */}
          {this.props.actors || this.props.actors.map(a=> <div>{a.name}</div>)}
        </div>
      </div>
    );
  }
}
const mapStateToProps = state => ({
    actors:state.search.actors
});
export default connect(mapStateToProps, { getActors})(Actors);
